import React from "react";
import { HashLink } from "react-router-hashlink";
const Header = () => {
  return (
    <nav className="navbar">
      <ul>
        <HashLink className="link" to="/#home-title">
          Homes
        </HashLink>
      </ul>
    </nav>
  );
};

export default Header;
